import React from "react";
import { Link } from "react-router-dom";
import "./Header.css";

const Header = ({ isLoggedIn, onLogout }) => {
  return (
    <div className="header">
      <div className="logo">
        <Link to="/">
          <p className="ft-title1">
            {/* <img src="/favicon.ico" alt="Favicon" className="favicon" /> Add favicon image */}
            MYMEDI <span className="ft-sign1">RECORDS</span>
          </p>
        </Link>
      </div>
      <div className="auth-links">
        {isLoggedIn ? (
          <>
            <Link to="/dashboard" className="auth-link">Dashboard</Link>
            <span> | </span>
            <Link to="/" onClick={onLogout} className="auth-link">Logout</Link>
          </>
        ) : (
          <>
            <Link to="/login" className="auth-link">Sign In</Link>
            <span> | </span>
            <Link to="/register" className="auth-link1">Sign Up</Link>
          </>
        )}
      </div>
    </div>
  );
};

export default Header;
